import React from 'react';
import ReturndAsh from './Dash';
import GridLoader from 'react-spinners/GridLoader';
import '../Loading.css';

// Dash board view 
export default function DAsh() {

 const [loading, setLoading] = React.useState(false);
 React.useEffect(() => {

  setLoading(true);
  setTimeout(() => {
   setLoading(false);
  }, 3600);

 }, []);

 return (
  <div>
   {
    loading ?
     <div className='App-loading'>
      <GridLoader
       size={15}
       color={'#00b8d4'}
       loading={loading}
      />
     </div>
     :
     <ReturndAsh />
   };
  </div>
 );
};
